import Input from "../Input"

function Pesquisa() {
    return (
        <section>
            <h1> Encontre algo para ler </h1>
            <h3> Busque na nossa estante! </h3>
            <Input
                placeholder="Titulo do livro..."
            />
        </section>
    )
}

export default Pesquisa
